//import logo from './logo.svg';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';

import './App.css';

function App() {
  return (
    <Router>
      <div>
        <Routes>
          <Route exact path="/" element={<HomePage />} />
          <Route path="/studentprofile" element={<StudentProfile />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
